import React from 'react';

const CurrentWeatherCard = ({ cityName, stateName, currentTime, icon, temp, wind }) => {
  return (
  <div>
      <h2>{cityName}{stateName}</h2>
      {/* put in clock? */}
      <h3>{currentTime}</h3>S
      <icon>{icon}</icon>
      <p>{temp}<br/>{wind}</p>
  </div>
  )
};

export default CurrentWeatherCard;
